import React from "react";
import "../styles/Header.css";

const Header = () => {
  const username = localStorage.getItem("username");

  return (
    <header className="app-header">
      {username ? (
        <div className="user-greeting">Salut, {username}!</div>
      ) : null}
    </header>
  );
};

export default Header;
